api = get_api(credentials)
repo_path = repo_url.replace('https://github.com/', '')
owner, repo = repo_path.split('/')
query = """
        query($owner: String!, $repo: String!, $num: Int!) {
            repository(owner: $owner, name: $repo) {
                discussions(first: $num) {
                    nodes {
                        title
                        url
                    }
                }
            }
        }
        """
variables = {'owner': owner, 'repo': repo, 'num': num_discussions}
response = api.post('https://api.github.com/graphql', json={'query': query,
    'variables': variables})
data = response.json()
discussions: list[GithubListDiscussionsBlock.Output.DiscussionItem] = [{
    'title': discussion['title'], 'url': discussion['url']} for discussion in
    data['data']['repository']['discussions']['nodes']]
return discussions
